import React from "react";
import "./AboutUs.css";

const AboutUs = () => {
  return (
    <div className="about-us-container">
      <div className="background-image">
        <div className="text-overlay">
          <h1>Welcome to The Budget Techie Explorer</h1>
          <div className="about-content">
            <p className="about-p">
              We are merge tech enthusiasm with a passion for budget-friendly
              travel. We're a hub for digital nomads and adventure seekers,
              offering insights and tips for exploring the world affordably. Our
              firsthand experiences shape authentic recommendations, from
              tech-friendly accommodations to offbeat discoveries. We celebrate
              the synergy of technology and wanderlust, guiding you through
              cost-effective adventures. Join us as we uncover hidden gems,
              share savvy travel hacks, and embrace the thrill of exploration
              without breaking the bank.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AboutUs;
